import styled from "styled-components";

const Container = styled.div`
    height 10vh;
    width 20vw;
`;

const Oval = styled.div`
    height:50px;
    width: 75px;
    border-radius: 50%;
    background-color: #ede3df;
`;

const Text = styled.div`
    font-family: 'Bitterslide Evelwhite', sans-serif; 
`;

                                                
const Logo = () => {
    <Container>
        <Oval/>            
        <Text>CULT</Text>
    </Container>   
}

export default Logo;
